 workload with a multi-possession second-half lead in hand. Johnson took full advantage of increased opportunity, doubling Chase Claypool for the team lead in targets and translating that into his second consecutive outing of 110-plus receiving yards. A Week 12 matchup against the Ravens appears far more prohibitive, as Baltimore has allowed the second-fewest receiving TDs (five) to opposing wideouts on the season.\",\"title\":\"Another lucrative receiving day\"},{\"timeEpochMilli\":\"1606095451000\",\"contents\":\"Pittsburgh Steelers wide receiver Diontae Johnson caught 12 of 16 targets for 111 yards in a 27-3 win over the Jacksonville Jaguars in Week 11. Johnson has now topped 100 receiving yards in two straight contests as he has reasserted himself as the team's No. 1 wide receiver. The second-year wide receiver now has at least six catches in four of his past five games with his 12 grabs on Sunday going into the books as a career-high. Johnson will remain a solid fantasy option in Week 12 against the ...\",\"url\":\"https://www.rotoballer.com/player-news/diontae-johnson-posts-second-straight-100-yard-game/806939\",\"title\":\"Diontae Johnson Posts Second Straight 100-Yard Game\"}],\"nameFirst\":\"Diontae\",\"nameLast\":\"Johnson\",\"proTeam\":{\"abbreviation\":\"PIT\",\"location\":\"Pittsburgh\",\"name\":\"Steelers\"},\"externalIds\":[{\"id\":\"244c00c7-fe9a-4f4f-adff-1d5b9c8877e7\"}],\"positionEligibility\":[\"WR\"]},\"requestedGames\":[{\"game\":{\"id\":6307,\"away\":{\"abbreviation\":\"PIT\",\"location\":\"Pittsburgh\",\"name\":\"Steelers\"},\"home\":{\"abbreviation\":\"JAC\",\"location\":\"Jacksonville\",\"name\":\"Jaguars\"},\"startTimeEpochMilli\":\"1606068000000\",\"status\":\"FINAL_SCORE\",\"awayScore\":27,\"homeScore\":3,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":\"LOSE\",\"awayResult\":\"WIN\"},\"stats\":[{\"category\":{\"id\":175,\"abbreviation\":\"Rec\",\"nameSingular\":\"Target % Caught\",\"namePl