eWeek\":7,\"news\":[{\"timeEpochMilli\":\"1606095579000\",\"contents\":\"Parker caught six of nine targets for 61 yards and a touchdown in Sunday's 20-13 loss to the Broncos.\",\"analysis\":\"His three-yard grab late in the first quarter gave the Dolphins an early lead, but it was the only TD they would score on the afternoon. Parker led Miami in catches, targets and receiving yards, and he remains the team's clear No. 1 wideout heading into Week 12's clash with a Jets defense that just got torched by the Chargers' passing attack.\",\"title\":\"Finds end zone in loss\"},{\"timeEpochMilli\":\"1606107502000\",\"contents\":\"Miami Dolphins wide receiver DeVante Parker put together a nice outing after posting a dud the week prior. He hauled in six of his nine targets for 61 yards and one touchdown in the Week 11 loss to the Denver Broncos. Tua Tagovailoa was benched in the fourth quarter, so Parker owners were probably happy to see that. However, Tagovailoa is expected to start next week versus the New York Jets. Parker has better fantasy value with Ryan Fitzpatrick under center, but that seems unlikely to happen....\",\"url\":\"https://www.rotoballer.com/player-news/devante-parker-bounces-back-in-week-11/807021\",\"title\":\"DeVante Parker Bounces Back In Week 11\"}],\"nameFirst\":\"DeVante\",\"nameLast\":\"Parker\",\"proTeam\":{\"abbreviation\":\"MIA\",\"location\":\"Miami\",\"name\":\"Dolphins\"},\"externalIds\":[{\"id\":\"e9ee9209-dd8f-4e4a-be3c-407756a2749c\"}],\"positionEligibility\":[\"WR\"]},\"requestedGames\":[{\"game\":{\"id\":6413,\"away\":{\"abbreviation\":\"MIA\",\"location\":\"Miami\",\"name\":\"Dolphins\"},\"home\":{\"abbreviation\":\"DEN\",\"location\":\"Denver\",\"name\":\"Broncos\"},\"startTimeEpochMilli\":\"1606079100000\",\"status\":\"FINAL_SCORE\",\"awayScore\":13,\"homeScore\":20,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":\"WIN\",\"awayResult\":\"LOSE\"},\"stats\":[{\"category\":{\"id\":175,\"abb