o his left knee in the Week 11 loss to the Washington Football Team. Burrow will undergo season-ending reconstructive surgery on his knee and could be out anywhere from nine to 12 months, which would put his status for the beginning of the 2021 season in question. It could make him a risky high-end QB2 for fantasy managers going into draft season next year....\",\"url\":\"https://www.rotoballer.com/player-news/joe-burrow-has-more-damage-in-knee/807196\",\"title\":\"Joe Burrow Has More Damage In Knee\"}],\"isRookie\":true,\"nameFirst\":\"Joe\",\"nameLast\":\"Burrow\",\"proTeam\":{\"abbreviation\":\"CIN\",\"location\":\"Cincinnati\",\"name\":\"Bengals\"},\"externalIds\":[{\"id\":\"3023ac10-4e7f-425f-9fc5-2b8e6332c92e\"}],\"positionEligibility\":[\"QB\"]},\"requestedGames\":[{\"game\":{\"id\":6306,\"away\":{\"abbreviation\":\"CIN\",\"location\":\"Cincinnati\",\"name\":\"Bengals\"},\"home\":{\"abbreviation\":\"WAS\",\"location\":\"Washington\",\"name\":\"Football Team\"},\"startTimeEpochMilli\":\"1606068000000\",\"status\":\"FINAL_SCORE\",\"awayScore\":9,\"homeScore\":20,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":\"WIN\",\"awayResult\":\"LOSE\"},\"stats\":[{\"category\":{\"id\":12,\"abbreviation\":\"%\",\"nameSingular\":\"Completion Percentage\",\"namePlural\":\"Completion Percentage\"},\"value\":{\"value\":64.70588,\"formatted\":\"22/34\"}},{\"category\":{\"id\":3,\"abbreviation\":\"Yd\",\"nameSingular\":\"Passing Yard\",\"namePlural\":\"Passing Yards\"},\"value\":{\"value\":203.0,\"formatted\":\"203\"}},{\"category\":{\"id\":5,\"abbreviation\":\"TD\",\"nameSingular\":\"Passing TD\",\"namePlural\":\"Passing TDs\"},\"value\":{\"value\":1.0,\"formatted\":\"1\"}},{\"category\":{\"id\":7,\"abbreviation\":\"INT\",\"nameSingular\":\"Interception\",\"namePlural\":\"Interceptions\",\"lowerIsBetter\":true},\"value\":{\"formatted\":\"0\"}}],\"pointsActual\":{\"value\":17.32,\"formatted\":\"17.32\"},\"period\":{\"ordinal\":11,\