n the scene with this performance, his best of the year so far. He was the apple of new starter Taysom Hill's eye, as no Saints' receiver came even close to his 12 targets. It could have potentially been an even bigger day, as Thomas dropped a wide-open, 25-yard pass. Still, this was the type of player fantasy managers thought they were getting. He may ...\",\"url\":\"https://www.rotoballer.com/player-news/michael-thomas-tallies-game-high-receiving-numbers/806860\",\"title\":\"Michael Thomas Tallies Game-High Receiving Numbers\"}],\"nameFirst\":\"Michael\",\"nameLast\":\"Thomas\",\"proTeam\":{\"abbreviation\":\"NO\",\"location\":\"New Orleans\",\"name\":\"Saints\"},\"externalIds\":[{\"id\":\"90c1756d-1f47-41b7-89fe-b113c9850bc1\"}],\"positionEligibility\":[\"WR\"]},\"requestedGames\":[{\"game\":{\"id\":6304,\"away\":{\"abbreviation\":\"ATL\",\"location\":\"Atlanta\",\"name\":\"Falcons\"},\"home\":{\"abbreviation\":\"NO\",\"location\":\"New Orleans\",\"name\":\"Saints\"},\"startTimeEpochMilli\":\"1606068000000\",\"status\":\"FINAL_SCORE\",\"awayScore\":9,\"homeScore\":24,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":\"WIN\",\"awayResult\":\"LOSE\"},\"stats\":[{\"category\":{\"id\":175,\"abbreviation\":\"Rec\",\"nameSingular\":\"Target % Caught\",\"namePlural\":\"Target % Caught\"},\"value\":{\"value\":75.0,\"formatted\":\"9/12\"}},{\"category\":{\"id\":42,\"abbreviation\":\"Yd\",\"nameSingular\":\"Receiving Yard\",\"namePlural\":\"Receiving Yards\"},\"value\":{\"value\":104.0,\"formatted\":\"104\"}},{\"category\":{\"id\":26,\"abbreviation\":\"Fum\",\"nameSingular\":\"Fumble\",\"namePlural\":\"Fumbles\",\"lowerIsBetter\":true},\"value\":{\"formatted\":\"0\"}},{\"category\":{\"id\":29,\"abbreviation\":\"TD\",\"nameSingular\":\"Offensive + Special Teams TD\",\"namePlural\":\"Offensive + Special Teams TDs\"},\"value\":{\"formatted\":\"0\"}}],\"statsProjected\":[{\"category\":{\"id\":175,\"abbreviation\":\"Rec\",\"nameSing