.\",\"title\":\"Gets back into end zone Sunday\"},{\"timeEpochMilli\":\"1606085862000\",\"contents\":\"Carolina Panthers running back Mike Davis compiled 19 rushes for 64 yards and a score along with two receptions for 15 yards on two targets in Week 11. Davis continued to fill in as the RB1 while Christian McCaffrey recovers from a shoulder injury. If McCaffrey returns, then Davis is no longer fantasy relevant. If the star RB cannot play, Davis should remain in the starting tier due to volume. Nevertheless, the backup RB has not rushed for more than 66 yards since Week 5.\",\"url\":\"https://www.rotoballer.com/player-news/mike-davis-has-rushing-touchdown/806838\",\"title\":\"Mike Davis Has Rushing Touchdown\"}],\"nameFirst\":\"Mike\",\"nameLast\":\"Davis\",\"proTeam\":{\"abbreviation\":\"CAR\",\"location\":\"Carolina\",\"name\":\"Panthers\"},\"externalIds\":[{\"id\":\"e311a7a2-eddb-439c-86b4-b1f1984186bc\"}],\"positionEligibility\":[\"RB\"]},\"requestedGames\":[{\"game\":{\"id\":6302,\"away\":{\"abbreviation\":\"DET\",\"location\":\"Detroit\",\"name\":\"Lions\"},\"home\":{\"abbreviation\":\"CAR\",\"location\":\"Carolina\",\"name\":\"Panthers\"},\"startTimeEpochMilli\":\"1606068000000\",\"status\":\"FINAL_SCORE\",\"homeScore\":20,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":\"WIN\",\"awayResult\":\"LOSE\"},\"stats\":[{\"category\":{\"id\":22,\"abbreviation\":\"Yd\",\"nameSingular\":\"Rushing Yard\",\"namePlural\":\"Rushing Yards\"},\"value\":{\"value\":64.0,\"formatted\":\"64\"}},{\"category\":{\"id\":175,\"abbreviation\":\"Rec\",\"nameSingular\":\"Target % Caught\",\"namePlural\":\"Target % Caught\"},\"value\":{\"value\":100.0,\"formatted\":\"2/2\"}},{\"category\":{\"id\":42,\"abbreviation\":\"Yd\",\"nameSingular\":\"Receiving Yard\",\"namePlural\":\"Receiving Yards\"},\"value\":{\"value\":15.0,\"formatted\":\"15\"}},{\"category\":{\"id\":29,\"abbreviation\":\"TD\",\"nameSingular\":\"Offensive + Special Teams TD\",