yeWeek\":13,\"news\":[{\"timeEpochMilli\":\"1606080851000\",\"contents\":\"Walker completed 24 of 34 passes for 258 yards with one touchdown and two interceptions in the Panthers' 20-0 win over the Lions on Sunday. He also netted minus-2 yards on five rushes, and he fumbled once but recovered.\",\"analysis\":\"Making what could be termed a quasi-last-minute spot start for Teddy Bridgewater (knee) -- whose status was in doubt until pregame warmups -- Walker acquitted himself very well overall in his first NFL opportunity to open a game under center. The former XFL star displayed impressive accuracy even while keeping his targets limited to just four pass catchers overall. However, three of those were the top wideout trio of DJ Moore, Curtis Samuel and Robby Anderson, who Walker hit for at least one double-digit completion apiece, including a nifty 17-yard touchdown toss to Samuel. Carolina's defense also played its best game of the season by far, helping support the inexperienced signal-caller with its play. Bridgewater reportedly is likely to return for a Week 12 road matchup versus the Vikings, but even if this turns out to be Walker's only start, he undoubtedly picked up some valuable experience and proved he's capable of stepping in should the former go down again at any point.\",\"title\":\"Holds own in Week 11 start\"}],\"nameFirst\":\"Phillip\",\"nameLast\":\"Walker\",\"proTeam\":{\"abbreviation\":\"CAR\",\"location\":\"Carolina\",\"name\":\"Panthers\"},\"externalIds\":[{\"id\":\"0666e6c6-42d9-40ab-83bd-7bbf81e9ac9c\"}],\"positionEligibility\":[\"QB\"]},\"requestedGames\":[{\"game\":{\"id\":6302,\"away\":{\"abbreviation\":\"DET\",\"location\":\"Detroit\",\"name\":\"Lions\"},\"home\":{\"abbreviation\":\"CAR\",\"location\":\"Carolina\",\"name\":\"Panthers\"},\"startTimeEpochMilli\":\"1606068000000\",\"status\":\"FINAL_SCORE\",\"homeScore\":20,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":\"WIN\",\"awayResult\":\"