ING_GOOD\"},{\"proPlayer\":{\"id\":15597,\"nameFull\":\"Chase Claypool\",\"nameShort\":\"C. Claypool\",\"proTeamAbbreviation\":\"PIT\",\"position\":\"WR\",\"headshotUrl\":\"https://d26bvpybnxg29h.cloudfront.net/nfl/15597.png\",\"news\":[{\"timeEpochMilli\":\"1606096404000\",\"contents\":\"Claypool caught four of eight targets for 59 receiving yards and a touchdown during Sunday's 27-3 win against Jacksonville.\",\"analysis\":\"JuJu Smith-Schuster suffered a toe injury Sunday, and though the team indicated he could have returned to the contest in a pinch, he was ultimately rested late in the game as Pittsburgh carried a substantial lead. That development opened up additional opportunities for the rookie out of Notre Dame, as he came down with his third TD catch of the past two weeks. Claypool's TD production is a key reason for why he's planted his name in the Offensive Rookie of the Year discussion, as he already has 10 scores (eight receiving, two rushing) on the season with six games still to play. A Week 12 matchup against Baltimore hampers expectations, as the Ravens are allowing the eighth-fewest yards per target to opposing wideouts on the year (7.8).\",\"title\":\"Hits paydirt again in win\"},{\"timeEpochMilli\":\"1606095830000\",\"contents\":\"Pittsburgh Steelers wide receiver Chase Claypool caught four of eight targets for 59 yards and a touchdown in a 27-3 win over the Jacksonville Jaguars in Week 11. Claypool and Ben Roethlisberger connected for a 31-yard score in the second quarter, giving Claypool 10 total touchdowns in his impressive rookie season. While Claypool continues to find the end zone often, he hasn't topped 74 receiving yards since back in Week 5. That has made him a bit touchdown-dependent in fantasy, of course that...\",\"url\":\"https://www.rotoballer.com/player-news/chase-claypool-scores-10th-td/806943\",\"title\":\"Chase Claypool Scores 10th TD\"}],\"isRookie\":true,\"nameFirst\":\"Chase\",\"nameLast\":\"Claypool\",\"proTeam\":{\"abbrevi