5,\"formatted\":\"12.56\"},\"seasonsStandartDeviation\":{\"value\":7.4887314,\"formatted\":\"7.49\"}},{\"proPlayer\":{\"id\":15604,\"nameFull\":\"Jonathan Taylor\",\"nameShort\":\"J. Taylor\",\"proTeamAbbreviation\":\"IND\",\"position\":\"RB\",\"headshotUrl\":\"https://d26bvpybnxg29h.cloudfront.net/nfl/15604.png\",\"nflByeWeek\":7,\"news\":[{\"timeEpochMilli\":\"1606102255000\",\"contents\":\"Taylor rushed the ball 22 times for 90 yards in Week 11 against the Packers. He added four receptions for 24 yards.\",\"analysis\":\"One week after being minimized in the offense, Taylor earned his first workhorse role. He looked comfortable, keeping the offense on schedule while also ripping off some big runs of 18 and 14 yards. Encouragingly, Taylor also remained involved in the passing attack and led the backfield with four receptions. While the Packers have been a soft matchup for running backs all season, the performance may have been what Taylor needed to find his footing during an uneven rookie campaign. He'll look to build on his best performance as a pro in Week 12 against the Titans.\",\"title\":\"Delivers against Packers\"},{\"timeEpochMilli\":\"1606094020000\",\"contents\":\"Indianapolis Colts running back Jonathan Taylor had an encouraging performance against the Packers after a few disappointing weeks. He rushed for 90 yards on 22 carries and also chipped in with four catches for 24 yards. His 22 carries was his second most all season, so it certainly looks like he is back in the coaching staff's good graces. Taylor showed that he could run it effectively, picking up a respectable 4.1 yards per carry. The uncertainty of his touches was a concern coming into the ...\",\"url\":\"https://www.rotoballer.com/player-news/jonathan-taylor-rushes-for-90-yards/806916\",\"title\":\"Jonathan Taylor Rushes For 90 Yards\"}],\"isRookie\":true,\"nameFirst\":\"Jonathan\",\"nameLast\":\"Taylor\",\"proTeam\":{\"abbreviation\":\"IND\",\"location\":\"Indianapolis\",\"name\":\"Colts\"}